import './App.css';
import Technologies from './Technologies';

import {Test1} from './Header';
import Header, { Test2 } from './Header';

const App = () => {
  return <div>
      <Header />
      <Technologies />
      <Test1 />
      <Test2 />
    </div>
}



export default App;
